import React from "react";
import { Redirect } from "react-router-dom";
import "../css/style.css";

function Main() {
  return (
    <>
      <section>
        <div className="container">
          <div className="content">
            <h1>Main Home</h1>
          </div>
        </div>
      </section>
    </>
  );
}

export default Main;
